import styled from 'styled-components';

const Container = styled.div`
  max-width: 800px;
  margin: 0 auto;
`;

const TodosPage = () => {
  return (
    <Container>
      <h1>Todo List</h1>
      <p>Manage your todos</p>
    </Container>
  );
};

export default TodosPage;
